function normalizeNameForComparison(name: string): string {
return name
  .toLowerCase()
  .normalize("NFD")
  .replace(/[̀-ͯ]/g, "")  // Remove diacritics
  .replace(/-/g, ' ')               // Replace hyphens with spaces
  .replace(/./g, '')              // Remove periods
  .trim();                          // Remove leading/trailing whitespace
}`}),`
